Step-by-step reasoning:

• Key Psychological Mechanisms:
 – In proposer decisions, a key mechanism is the fairness evaluation based on relative contributions. In this experiment, each participant’s contribution (token_self) and the opponent’s contribution (token_opp) are observed. A natural signal is the proportion of the opponent’s tokens relative to the total tokens, which can be interpreted as a fairness ratio.
 – The proposer’s decision on what percentage to offer the opponent (proposed_perc) is hypothesized to depend on this fairness ratio: a higher proportion of tokens for the opponent would be associated with a higher percentage offer.
 – An additional baseline bias (intercept) may capture the general tendency or norm that is independent of tokens.

• How These Mechanisms Interact:
 – The fairness ratio (token_opp / (token_self + token_opp)) is computed to encapsulate the relative contributions.
 – The proposer’s offer is then modeled as a linear combination of a baseline intercept and the weighted fairness ratio.

• Mathematical Form:
 – Let fairness_ratio = token_opp / (token_self + token_opp).
 – Then the predicted proposed percentage (proposed_perc_pred) can be modeled as:
  proposed_perc_pred = alpha + beta × fairness_ratio
 – Where alpha is the baseline proposal and beta is the sensitivity parameter to fairness signals.

• Learnable Parameters:
 – alpha: Represents the baseline incentive for proposing a percentage offer. (Bounds: a generous range, e.g., −100 to 100)
 – beta: Represents the weight or sensitivity on the fairness ratio. (Bounds: likewise −100 to 100)
 – These parameters are chosen to be minimal to reduce covariance while still capturing essential variation.

• Mapping to Observable Behavior:
 – The computed fairness_ratio is fully derived from the observed data variables token_opp and token_self.
 – The target variable, proposed_perc, is directly predicted from the model.
 – Noise and residual error in behavior are implicitly captured by comparing predictions to the survey’s proposed_perc values using MSE.

